using BO;using Helpers;public class CallAssignmentInList{    // Volunteer ID (from DO.Assignment)    public int VolunteerId { get; set; }    // Volunteer Name (from DO.Volunteer)    public string VolunteerName { get; set; }    // Start time when the volunteer begins treatment for the call    public DateTime StartTime { get; set; }    // Actual end time when the volunteer finishes treatment (if completed)    public DateTime? EndTime { get; set; }    // Completion type of the treatment (e.g., completed, canceled, expired)    public AssignmentCompletionType? CompletionType { get; set; }    public override string ToString() => this.ToStringProperty();}